import React from "react";
import styles from "../../style/products/subnav.module.css";
import { Link } from "react-router-dom";

function SubNav() {
  return (
    <div className={styles.subNavContainer}>
      <ul>
        <li>
          {/* <Link to="/products">All</Link> */}
        </li>
        <li>
          <Link to="/products/Marvel">Marvel</Link>
        </li>
        <li>
          <Link to="/products/Expensive">Expensive</Link>
        </li>
        <li>
          <Link to="/products/Kid">Kid</Link>
        </li>

      </ul>
    </div>
  );
}

export default SubNav;
